Malcolm X - The Essential.

The main item of this compilation is the 1994 documentary about Malcolm X, titled : &quot;Make It Plain&quot;.

The rest are 7 pictures of the man, 3 audio (&quot;Field Negro&quot; is very much liked) and a small video excerpt from his visit to Oxford University (England) in 1964.

Compilation size : 754 MB, out of which 726 MB are for the video &quot;Make it Plain&quot;.

